exports=async function(bid,options){const{parseCatalog}=await require("transcode/parse_catalog"),url=`https://www.epzw.com/html/${bid.idPrefix()}/${bid}/`;return parseCatalog(url,[/class="chapterlist">[\S\s]*<ul>(?<fragment>(?:\s*<li>\s*<a[^>]*>[^<]*<\/a>\s*<\/li>)*)/,/<a href="(?<url>[^"]+)">(?<name>[^<]+)/g],{clientOptions:{...(options&&options.clientOptions)},webview:!0})};